const card = () => {
    return (
        <div>
            <img alt="robots" src="https://robohash.org/test?200x200"></img>
            <div>
                <h2>jone doe</h2>
                <p>jone.doe@gmail.com</p>
            </div>
        </div>
    );
}

export default card;
